import React from 'react'
import PropTypes from "prop-types"
import { Input, InputNumber, Button } from 'antd'
import './Home.css'

export default class Home extends React.Component {
    static propTypes = {
        getUser: PropTypes.func,
        getUserInput: PropTypes.func,
        addUser: PropTypes.func,
    }

    constructor() {
        super()
        this.state = {
            currentValue: null,
        }
        this.currentValue = null
    }
    checkUser = (event) => {
        console.log('e target val: ', event.target.value)
        // val.key === 'Enter' ? this.props.addUser(this.state.currentValue) : this.setState({currentValue: val.target.value})
    }
     render() {
        const { getUser, getUserInput, addUser } = this.props
        return (
            <React.Fragment>
                <Input 
                    onKeyPress={(event) => event.key !== 'Enter' ? this.setState({currentValue: event.target.value}, () => {}) : addUser(this.state.currentValue)}
                    // onKeyPress={this.checkUser}
                    className='search-box'
                />
                <Button onChange={console.log(this.state.currentValue)} />
            </React.Fragment>
        )
    }
}
